import React, { useState } from 'react';

const App = () => {
  const [physician, setPhysician] = useState({
    name: '',
    specialty: '',
  });

  const handleSubmit = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/addPhysician', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(physician),
      });

      if (!response.ok) {
        throw new Error('Failed to add physician');
      }

      const result = await response.json();
      console.log(result);
    } catch (error) {
      console.error('Error adding physician:', error);
    }
  };

  return (
    <div>
      <h1>React App</h1>
      <form>
        <label>
          Name:
          <input
            type="text"
            value={physician.name}
            onChange={(e) => setPhysician({ ...physician, name: e.target.value })}
          />
        </label>
        <br />
        <label>
          Specialty:
          <input
            type="text"
            value={physician.specialty}
            onChange={(e) => setPhysician({ ...physician, specialty: e.target.value })}
          />
        </label>
        <br />
        <button type="button" onClick={handleSubmit}>
          Add Physician
        </button>
      </form>
    </div>
  );
};

export default App;
